import React from 'react';
import { Router, Route } from 'react-router-dom';

import Search from './Search';
import Header from './Header'

const Main = () => {
  return (
    <Router>
        {/* <Header/> */}
      <Route exact path='/' element={<Header/>}></Route>
      <Route exact path='/' element={<Search/>}></Route>
    </Router>
  );
}

export default Main;
